                case GameServerOpcodes.VanityToggle:
                    {
                        Logger.LogInformation("VanityToggle: " + (packet.Data?.ToArray()).ToHex());

                        break;
                    }

                default:
                    {
                        Logger.LogWarning($"Unknown packet: {packet}");
                        break;
                    }
            }
        }
    }
}
